import React,{useState} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,Pressable} from 'react-native';
import {css} from '../assets/Css/css';
import DateTimePicker from "@react-native-community/datetimepicker";



export default function Teste2 (props1) {
    const [dataDeNiver,setDataDeNiver] = useState("");
    const [date,setDate] = useState(new Date());
    const[showPicker,setShowPicker] = useState(false);
    const toggleDatepicker = () => {setShowPicker(!showPicker);};
    const onChange  = ({type},selectedDate) => {if(type =='set'){const currentDate = selectedDate; setDate(currentDate);}else{toggleDatepicker()}};
    return (
            <View style = {css.fundo}>
                {showPicker && (<DateTimePicker mode = 'date' display = 'spinner' value = {date} onChange={onChange}/>)}
                {!showPicker && (<Pressable onPress={toggleDatepicker}> <TextInput placeholder = 'Teste' value = {dataDeNiver} onChangeText={setDataDeNiver} editable = {false} /></Pressable>)}
               
            </View>
    );
    
}
